import "./UserProfile.css";
import { Col, Row, Container } from "react-bootstrap";
import UserProfileLayout from "../components/UserProfile/UserProfileLayout";
import React from "react";
import tenis from '../assets/Images/tennis.jpg'

const UserProfile = () => {
  return (
    <React.Fragment>
    <Container>
      <Row  style={{height:'400px', marginTop:'100px'}}>
        <Col style={{border:'1px solid black'}} md={8}>
          <img src={tenis} style={{width:'inherit', height:'inherit'}}/>
        </Col>
        <Col style={{border:'1px solid black'}}  md={4}>sm=4</Col>
      </Row>
      <Row  style={{height:'400px'}}>
        <Col style={{border:'1px solid black'}}  md={4}>sm=true</Col>
        <Col style={{border:'1px solid black'}}  md={4}>sm=true</Col>
        <Col style={{border:'1px solid black'}}  md={4}>sm=true</Col>
      </Row>
    </Container>


    <Container>
      <UserProfileLayout />
    </Container>
    </React.Fragment>
  );
};

export default UserProfile;
